-- 1. Criar o banco de dados CURSOS_INFORMATICA
USE master

if exists(select * from sysdatabases where name='CURSOS_INFORMATICA')
   DROP DATABASE CURSOS_INFORMATICA

CREATE DATABASE CURSOS_INFORMATICA;
GO

-- 2. Colocar o banco CURSOS_INFORMATICA em uso
USE CURSOS_INFORMATICA;

-- 3. Criar tabela CAD_SALAS
/*
		ID_SALA			inteiro, autonumerção e chave primária
		NUM_SALA		alfanumérico tamanho 15
		QTD_LUGARES		inteiro
		DATA_INCLUSAO		data e hora, não nulo, default data atual
		DATA_ALTERACAO		data e hora, não nulo, default data atual		
		SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
		                	aceita somente "S" ou "N"
*/
CREATE TABLE CAD_SALAS
(
	ID_SALA			INT		IDENTITY,
    	NUM_SALA		VARCHAR(20),
	QTD_LUGARES		TINYINT,
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO  DATETIME NOT NULL DEFAULT GETDATE(),	
	SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'S',
    CONSTRAINT PK_CAD_SALAS PRIMARY KEY (ID_SALA),
    CONSTRAINT CH_CAD_SALAS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))	
);
-- 4. Criar tabela CAD_PERIODOS
/*
	ID_PERIODO		inteiro, autonumerção e chave primária
    	PERIODO			alfanumérico tamanho 20
    	HORA_INICIO		hora
    	HORA_FIM		hora
	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual		
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
	                	aceita somente "S" ou "N"
*/
CREATE TABLE CAD_PERIODOS
(
	ID_PERIODO		INT		IDENTITY,
    	PERIODO			VARCHAR(20),
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO  DATETIME NOT NULL DEFAULT GETDATE(),
	HORA_INICIO		TIME,
	HORA_FIM		TIME,	
	SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'S',
    CONSTRAINT PK_CAD_PERIODOS PRIMARY KEY(ID_PERIODO),
    CONSTRAINT CH_CAD_PERIODOS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))
);

-- 5. Criar tabela de CAD_ESTADOS
/*
	ID_ESTADO		inteiro, autonumeração e chave primária
	COD_ESTADO_IBGE		inteiro, não nulo, não pode duplicar
	ESTADO			alfanumérico tamanho 2, não pode duplicar
	NOME_ESTADO		alfanumérico tamanho 20, não pode duplicar
	ICMS			numérico tamanho 4 com 2 decimais
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
	                	aceita somente "S" ou "N"
*/
CREATE TABLE CAD_ESTADOS (
    ID_ESTADO		INT IDENTITY, 
    COD_EST_IBGE    	INT NOT NULL,
    ESTADO          	CHAR(2) UNIQUE,
    NOME_ESTADO     	VARCHAR(20),
    ICMS            	NUMERIC(6,2),
    SN_ATIVO        	CHAR(1)  NOT NULL DEFAULT 'S',
    CONSTRAINT PK_CAD_ESTADOS PRIMARY KEY (ID_ESTADO),
    CONSTRAINT UQ_CAD_ESTADOS_COD_EST_IBGE UNIQUE(COD_EST_IBGE),
    CONSTRAINT UQ_CAD_ESTADOS_ESTADO UNIQUE(ESTADO),
    CONSTRAINT UQ_CAD_ESTADOS_NOME_ESTADO UNIQUE(NOME_ESTADO),
    CONSTRAINT CH_CAD_ESTADOS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))  
);

-- 6. Criar tabela de CAD_MUNICIPIOS
/*
	ID_MUNICIPIO		inteiro, autonumeração e chave primária
	COD_MUNIC_IBGE		inteiro, não nulo, não pode duplicar
	ID_ESTADO		inteiro, não nulo e chave estrangeira para CAD_ESTADOS
	MUNICIPIO		alfanumérico tamanho 50	
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
	                	aceita somente "S" ou "N"
*/
CREATE TABLE CAD_MUNICIPIOS (
    ID_MUNICIPIO	INT IDENTITY,
    COD_MUNIC_IBGE  	INT NOT NULL,
    ID_ESTADO		INT NOT NULL,
    MUNICIPIO		VARCHAR(50),
    SN_ATIVO		CHAR(1)  NOT NULL DEFAULT 'S',
    CONSTRAINT PK_CAD_MUNICIPIOS PRIMARY KEY (ID_MUNICIPIO),
    CONSTRAINT UQ_CAD_MUNICIPIOS_COD_MUNIC_IBGE UNIQUE(COD_MUNIC_IBGE),
    CONSTRAINT FK_CAD_MUNICIPIOS_CAD_ESTADOS FOREIGN KEY(ID_ESTADO)
               REFERENCES CAD_ESTADOS(ID_ESTADO), 
    CONSTRAINT CH_CAD_MUNICIPIOS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))      
);
-- 7. Criar tabela CAD_PESSOAS
/*
	ID_PESSOA		inteiro, autonumerção e chave primária
	NOME			alfanumérico tamanho 40
	LOGRADOURO		alfanumérico tamanho 50
	NUMERO			alfanumérico tamanho 15
	COMPLEMENTO		alfanumérico tamanho 30
	ID_MUNICIPIO		inteiro, não nulo e chave estrangeira para CAD_MUNICIPIOS
	CEP			alfanumérico tamanho 8
	FONE1			alfanumérico tamanho 14
	FONE2			alfanumérico tamanho 14
	E_MAIL			alfanumérico tamanho 100
	WEB_SITE		alfanumérico tamanho 100
	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual		
	SN_ALUNO		alfanumérico tamanho 1, não nulo, default 'S'
	                	aceita somente "S" ou "N"    
	SN_FUNCIONARIO  	alfanumérico tamanho 1, não nulo, default 'N'
	                	aceita somente "S" ou "N"    
	SN_INSTRUTOR		alfanumérico tamanho 1, não nulo, default 'N'
	                	aceita somente "S" ou "N"    
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'N'
	                	aceita somente "S" ou "N"    
*/

CREATE TABLE CAD_PESSOAS
(
	ID_PESSOA		INT			IDENTITY,
	NOME			VARCHAR(40),
	LOGRADOURO		VARCHAR(50),
	NUMERO			VARCHAR(15),
	COMPLEMENTO		VARCHAR(30),
	ID_MUNICIPIO		INT,
	CEP			CHAR(8),
	FONE1			CHAR(14),
	FONE2			CHAR(14),
	E_MAIL			VARCHAR(100),
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO  DATETIME NOT NULL DEFAULT GETDATE(),	
	SN_ALUNO		CHAR(1) NOT NULL DEFAULT 'S',
	SN_FUNCIONARIO  	CHAR(1) NOT NULL DEFAULT 'N',
	SN_INSTRUTOR		CHAR(1) NOT NULL DEFAULT 'N',
	SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'N',
    CONSTRAINT PK_CAD_PESSOAS PRIMARY KEY (ID_PESSOA),
    CONSTRAINT CH_CAD_PESSOAS_SN_ALUNO CHECK( SN_ALUNO IN ('S','N')),	    
    CONSTRAINT CH_CAD_PESSOAS_SN_FUNCIONARIO CHECK( SN_FUNCIONARIO IN ('S','N')),
    CONSTRAINT CH_CAD_PESSOAS_SN_INSTRUTOR CHECK( SN_INSTRUTOR IN ('S','N')),
    CONSTRAINT CH_CAD_PESSOAS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N')),            
);

-- 8. Criar tabela CAD_DEPTOS
/*
	ID_DEPTO		inteiro, autonumeração, chave primária
	DEPTO			alfanumérico tamanho 30 
	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual		
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
		            	aceita somente "S" ou "N"	
*/
CREATE TABLE CAD_DEPTOS
(	ID_DEPTO		INT			IDENTITY,
	DEPTO			VARCHAR(30),
	SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'S',
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO  DATETIME NOT NULL DEFAULT GETDATE(),	
	CONSTRAINT PK_CAD_DEPTOS PRIMARY KEY (ID_DEPTO),
    CONSTRAINT CH_CAD_DEPTOS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))
);                
    
-- 9. Criar tabela CAD_CARGOS
/*
	ID_CARGO		inteiro, autonumeração, chave primária
	CARGO			alfanumérico tamanho 30 
	SALARIO			numérico tamanho 10 com 2 decimais	
	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual		
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
		            	aceita somente "S" ou "N"		
*/
CREATE TABLE CAD_CARGOS
(	ID_CARGO		INT			IDENTITY,
	CARGO			VARCHAR(30),
	SALARIO			NUMERIC(10,2),
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO  DATETIME NOT NULL DEFAULT GETDATE(),	
	SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'S',
	CONSTRAINT PK_CAD_CARGOS PRIMARY KEY (ID_CARGO),
    CONSTRAINT CH_CAD_CARGOS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))
);
-- 10. Criar tabela CAD_FUNCIONARIOS
/*
	ID_PESSOA_FUNC		inteiro, chave primária, chave estrangeira para CAD_PESSOAS
	ID_DEPTO		inteiro, não nulo, chave estrangeira para CAD_DEPTOS
	ID_CARGO		inteiro, não nulo, chave estrangeira para CAD_CARGOS
	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual		
	DATA_ADMISSAO		data e hora, não nulo, default data atual
	PORC_COMISSAO		número com tamanho 4 e 2 decimais, não nulo
	                    	deve estar no intervalo de 0 até 10
	
*/
CREATE TABLE CAD_FUNCIONARIOS
(	ID_PESSOA_FUNC		INT,
	ID_DEPTO		INT NOT NULL,
	ID_CARGO		INT NOT NULL,
	DATA_INCLUSAO		DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO		DATETIME NOT NULL DEFAULT GETDATE(),	
	DATA_ADMISSAO	    	DATETIME NOT NULL DEFAULT GETDATE(),
	PORC_COMISSAO		NUMERIC(4,2),
	CONSTRAINT PK_CAD_FUNCIONARIOS PRIMARY KEY(ID_PESSOA_FUNC),
	CONSTRAINT FK_CAD_FUNCIONARIOS_CAD_PESSOAS FOREIGN KEY(ID_PESSOA_FUNC)
	           REFERENCES CAD_PESSOAS(ID_PESSOA),
	CONSTRAINT FK_CAD_FUNCIONARIOS_CAD_DEPTOS FOREIGN KEY(ID_DEPTO)
	           REFERENCES CAD_DEPTOS(ID_DEPTO),
	CONSTRAINT FK_CAD_FUNCIONARIOS_CAD_CARGOS FOREIGN KEY(ID_CARGO)
	           REFERENCES CAD_CARGOS(ID_CARGO),
	CONSTRAINT CH_CAD_FUNCIONARIOS_PORC_COMISSAO 
	           CHECK( PORC_COMISSAO BETWEEN 0 AND 10 )          	
);		
-- 11. Criar tabela CAD_INSTRUTORES_NIVEIS
/*
	ID_NIVEL		inteiro, autonumeração, chave primária
	NIVEL    		alfanumérico tamanho 20
	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual		
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
		                aceita somente "S" ou "N"		
*/
CREATE TABLE CAD_INSTRUTORES_NIVEIS
(	ID_NIVEL		INT				IDENTITY,
 	NIVEL    		VARCHAR(20),
 	DATA_INCLUSAO		DATETIME NOT NULL DEFAULT GETDATE(),
 	DATA_ALTERACAO	    	DATETIME NOT NULL DEFAULT GETDATE(),
 	SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'S',	
 	CONSTRAINT PK_CAD_INSTRUTORES_NIVEIS PRIMARY KEY(ID_NIVEL),
    CONSTRAINT CH_CAD_INSTRUTORES_NIVEIS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))	
);
-- 12. Criar tabela CAD_INSTRUTORES
/*
	ID_PESSOA_INSTR		inteiro, chave primária, chave estrangeira para CAD_PESSOAS
	DATA_ADMISSAO		data e hora, não nulo, default data atual
	ESCOLARIDADE        	alfanumérico tamanho 1, não nulo
	                    	aceita  "1": primeiro grau
	                        	"2": segundo grau
	                        	"3": superior incompleto
	                        	"4": superior completo
	                        	"5": pós graduado
    	CURRICULUM		texto longo	                           
*/
CREATE TABLE CAD_INSTRUTORES
(	ID_PESSOA_INSTR		INT,
	DATA_ADMISSAO		DATETIME NOT NULL DEFAULT GETDATE(),
	ESCOLARIDADE		CHAR(1) NOT NULL,
	CURRICULUM		VARCHAR(max),
	CONSTRAINT PK_CAD_INSTRUTORES PRIMARY KEY (ID_PESSOA_INSTR),
	CONSTRAINT FK_CAD_INSTRUTORES_CAD_PESSOAS FOREIGN KEY (ID_PESSOA_INSTR)
	           REFERENCES CAD_PESSOAS(ID_PESSOA),
	CONSTRAINT CH_CAD_INSTRUTORES_ESCOLARIDADE
	           CHECK( ESCOLARIDADE IN ('1','2','3','4','5'))           
);

-- 13. Criar tabela CAD_TREINAMENTOS_AREAS
/*
	ID_AREA		inteiro, autonumerção e chave primária,
	AREA		alfanumérico tamanho 30,
	DATA_INCLUSAO	data e hora, não nulo, default data atual
	DATA_ALTERACAO	data e hora, não nulo, default data atual		
	SN_ATIVO	alfanumérico tamanho 1, não nulo, default 'S'
	                aceita somente "S" ou "N"    
*/
CREATE TABLE CAD_TREINAMENTOS_AREAS
(
	ID_AREA			INT		IDENTITY,
	AREA			VARCHAR(30),
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO  DATETIME NOT NULL DEFAULT GETDATE(),	
    SN_ATIVO		CHAR(1) NOT NULL DEFAULT 'S',
    CONSTRAINT PK_CAD_AREAS_TREINAMENTO PRIMARY KEY (ID_AREA),
    CONSTRAINT CH_AREAS_TREINAMENTO_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))
);

-- 14. Criar tabela CAD_TREINAMENTOS
/*
	ID_TREINAMENTO		inteiro, autonumerção e chave primária
	TREINAMENTO		alfanumérico tamanho 40
	ID_AREA			inteiro, não nulo, chave estrangeira para CAD_AREAS_TREINAMENTO
	CARGA_HORARIA		inteiro
   	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual			
	SN_ATIVO		alfanumérico tamanho 1, não nulo, default 'S'
		                aceita somente "S" ou "N"
*/
CREATE TABLE CAD_TREINAMENTOS
(
	ID_TREINAMENTO		INT			IDENTITY,
	TREINAMENTO		VARCHAR(40),
	ID_AREA			INT,
	CARGA_HORARIA		TINYINT,
	DATA_INCLUSAO		DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO		DATETIME NOT NULL DEFAULT GETDATE(),	
	SN_ATIVO			CHAR(1) NOT NULL DEFAULT 'S',
    CONSTRAINT PK_CAD_TREINAMENTOS PRIMARY KEY (ID_TREINAMENTO),
    CONSTRAINT PK_CAD_TREINAMENTOS_CAD_TREINAMENTOS_AREAS FOREIGN KEY (ID_AREA)
               REFERENCES CAD_TREINAMENTOS_AREAS(ID_AREA),
    CONSTRAINT CH_CAD_TREINAMENTOS_SN_ATIVO CHECK( SN_ATIVO IN ('S','N'))	           
);


-- 15. Criar tabela CAD_INSTRUTORES_TREINAMENTOS
/*
	ID_PESSOA_INSTR			inteiro, não nulo, chave estrangeira para CAD_PESSOAS
	ID_TREINAMENTO			inteiro, não nulo, chave estrangeira para 					CAD_TREINAMENTOS
   	DATA_INCLUSAO			data e hora, não nulo, default data atual	
   	VLR_HORA			numérico tamanho 6 com 2 decimais
   	ID_NIVEL			inteiro, não nulo, chave estrangeira para 					CAD_INSTRUTORES_NIVEIS
    OBS.: A chave primária é composta pelos 2 campos
*/
CREATE TABLE CAD_INSTRUTORES_TREINAMENTOS
(
	ID_PESSOA_INSTR			INT,
	ID_TREINAMENTO			INT,
	DATA_INCLUSAO			DATETIME NOT NULL DEFAULT GETDATE(),
	VLR_HORA				NUMERIC(6,2),
	ID_NIVEL				INT NOT NULL,
    CONSTRAINT PK_CAD_INSTRUTORES_TREINAMENTOS
       PRIMARY KEY (ID_PESSOA_INSTR,ID_TREINAMENTO),
    CONSTRAINT FK_CAD_INSTRUTORES_TREINAMENTOS_CAD_TREINAMENTS
       FOREIGN KEY (ID_TREINAMENTO) REFERENCES CAD_TREINAMENTOS(ID_TREINAMENTO),
    CONSTRAINT FK_CAD_INSTRUTORES_TREINAMENTOS_CAD_INSTRUTORES_NIVEIS
       FOREIGN KEY (ID_NIVEL) REFERENCES CAD_INSTRUTORES_NIVEIS(ID_NIVEL)          
);


-- 16. Criar tabela MOV_CURSOS
/*
	ID_CURSO		inteiro, autonumerção e chave primária
	ID_TREINAMENTO		inteiro, não nulo, chave estrangeira para CAD_TREINAMENTOS
	ID_PESSOA_INSTR		inteiro, não nulo, chave estrangeira para CAD_PESSOAS
	ID_SALA			inteiro, não nulo, chave estrangeira para CAD_SALAS
	ID_PERIODO		inteiro, não nulo, chave estrangeira para CAD_PERIODOS
	DATA_INICIO		data, não nulo
	DATA_FIM		data, não nulo
   	DATA_INCLUSAO		data e hora, não nulo, default data atual
	DATA_ALTERACAO		data e hora, não nulo, default data atual			
    -- "0": Pendente, "1": Em andamento, "2": Finalizado
	STATUS				alfanumérico tamanho 1
*/
CREATE TABLE MOV_CURSOS
(
	ID_CURSO		INT		IDENTITY,
	ID_TREINAMENTO		INT NOT NULL,
	ID_PESSOA_INSTR		INT NOT NULL,
	ID_SALA			INT NOT NULL,
	ID_PERIODO		INT NOT NULL,
	DATA_INICIO		DATETIME NOT NULL,
	DATA_FIM		DATETIME NOT NULL,
    DATA_INCLUSAO		DATETIME NOT NULL DEFAULT GETDATE(),
	DATA_ALTERACAO		DATETIME NOT NULL DEFAULT GETDATE(),	
    -- "0": Pendente, "1": Em andamento, "2": Finalizado
	STATUS				CHAR(1),
    CONSTRAINT PK_MOV_CURSOS PRIMARY KEY(ID_CURSO),
    CONSTRAINT CH_MOV_CURSOS_STATUS CHECK (STATUS IN ('0','1','2')) ,
    CONSTRAINT FK_MOV_CURSOS_CAD_TREINAMENTOS FOREIGN KEY(ID_TREINAMENTO)
               REFERENCES CAD_TREINAMENTOS (ID_TREINAMENTO),
    CONSTRAINT FK_MOV_CURSOS_CAD_PESSOAS FOREIGN KEY(ID_PESSOA_INSTR)
               REFERENCES CAD_PESSOAS (ID_PESSOA),               
    CONSTRAINT FK_MOV_CURSOS_CAD_SALAS FOREIGN KEY(ID_SALA)
               REFERENCES CAD_SALAS (ID_SALA),               
    CONSTRAINT FK_MOV_CURSOS_CAD_PERIODOS FOREIGN KEY(ID_PERIODO)
               REFERENCES CAD_PERIODOS (ID_PERIODO)
);

-- 17. Criar tabela MOV_CURSOS_ALUNOS
/*
	ID_CURSO		inteiro
	ID_PESSOA_ALUNO		inteiro	
    DATA_INCLUSAO		data e hora, não nulo, default data atual	
    OBS.: A chave primária é composta por ID_CURSO e ID_PESSOA_ALUNO
*/
CREATE TABLE MOV_CURSOS_ALUNOS
(
	ID_CURSO		INT,
	ID_PESSOA_ALUNO		INT,
	DATA_INCLUSAO   DATETIME NOT NULL DEFAULT GETDATE(),	
    CONSTRAINT PK_MOV_CURSOS_ALUNOS
               PRIMARY KEY (ID_CURSO, ID_PESSOA_ALUNO)
);

GO

